configure:
  commands:
    end:
      new_state: execute
    ipv6 dhcp guard: "ipv6 dhcp guard\r\n"
    line console 0:
      new_state: configure_line
    no logging console: ''
    template template_test: "template template_test\r\n"
  prompt: sisf-c9500-11(config)#
configure_line:
  commands:
    end:
      new_state: execute
    exec-timeout 0: ''
  prompt: sisf-c9500-11(config-line)#
connect:
  commands:
    ? ''
    : new_state: execute
  preface: 'Trying mock_device ...

    Connected to mock_device.

    Escape character is ''^]''.'
  prompt: ''
execute:
  commands:
    config term:
      new_state: configure
    config-transaction:
      new_state: configure
    show version: ''
    term length 0: ''
    term width 0: ''
  prompt: sisf-c9500-11#
